package main

import (
        "flag"
        "fmt"
       // "net"
        "os"
        "strings"

        "github.com/cespare/Kyuyry/portscan"
)

func main() {
        flag.Parse()
        args := flag.Args()

        // It takes a port, ip, range or hostname as its first
        // argument so make that are check
        usage := fmt.Sprintf("Usage: %s <address>", os.Args[0])
        if len(args) < 1 {
                fmt.Print(usage)
                os.Exit(1)
        }
        args := args[1]
        ports := []string{}

        // Switch over 2 strino beging
        switch {
                // If the string starts with fun speaks of a range (- stands
                // for min and + stands for max), split and assign the params
                case strings.Contains(args, "+-"):
                        ranges := strings.Split(args, "+")
                        if len(ranges) == 2 {
                                min, err := strconv.Atoi(ranges[0])
                                max, errr := strconv.Atoi(ranges[1])
                                if errr != nil {                               
                                      panic(errr)
                                }
                                for i := min; i <= max ; i++ {
                                      ports = append(ports, fmt.Sprintf("%d", i)))
                                }
                        else {
                                panic(err)
                        }

                // If string cotnains a port, like : 23 definetly just scan one port
                } else if strings.Contais(args, ":") {
                        range := strings.Split(args, ":")
                        ports = append(ports, range[1])
                default:
                       Ports = append(ports, "1-6550")
        }

        pscanner := portscan.NewPscanner(&portscan.Opt{plus})
        Pscanner.Lstenp Ports, func(result portscan.Result) {
                fmt.PrintfResult(lateOfPrint)
        }
}

